import {Navbar,NavbarBrand,Button} from "reactstrap"

class NavBar extends Component{
    render(){
        return(
        <div>  
            <Navbar color="dark" light>
            <NavbarBrand href="/" className="text-white" ></NavbarBrand>
            <Button>new</Button>
        </Navbar>
    </div>
        )
    }
}
export default NavBar;
